import React, { useState, useEffect } from "react";

const Body = () => {
  const [fishList, setFish] = useState("");

  useEffect(() => {
    fetch("https://www.fishwatch.gov/api/species")
      .then((res) => res.json())
      .then(
        (fish) => {
          console.log(fish[1]);
          setFish(fish[1].Taste);
        },
        (error) => {
          console.log("error");
        }
      );
  }, [fishList]);

  return (
    <div>
      <h1 dangerouslySetInnerHTML={fishList[1].Taste}></h1>
    </div>
  );
};

export default Body;
